import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":80,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":80,"name":"妮可","summary":"妮可·德玛拉","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/25/76099754/1cb64706be3eca5400e7cc02b8a82e60_3042993825218318926.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/8f520464cfe63ddd5d2c12c65489173b_2669476873752582956.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/29698b5fe55ca772b121ee7ffa28c379_7416759043283841449.png"},"attrs":[["稀有度","A"],["属性","以太"],["特性","支援"],["阵营","狡兔屋"]],"destiny":[["LEVEL1增压强化弹","[强化特殊技]造成的伤害和累积的属性异常积蓄值提升16%；发动[强化特殊技]时，每多蓄力0.1秒，在目标处生成的能量场持续时间提升0.15秒。「你们都被我强化了，赶紧上！」「什么，我、我才没有想趁机逃跑，只是需要休息下而已！」"],["LEVEL2聚能装置","触发[核心被动：机关箱]的减益效果时，妮可回复5点能量，15秒内最多触发一次。「不要小看增加的这一秒钟！」「你知道这一秒内，我能产生多少价值吗？那可是数都数不清！」「所以，我再多要10%的补贴，不过分吧？ 」"],["LEVEL3狡兔智慧","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2既没有卓绝的武力，也没有丰厚的资源，妮可能把狡兔屋运营至今靠的是灵活的头脑。"],["LEVEL4领域扩增","妮可发动[强化特殊技]、[连携技]、[终结技]时，在目标处生成的能量场攻击范围提升，直径增加3米。「这里，还有这里，以后都会成为狡兔屋的领域，你听明白了吗！」「什么，你问多久之后？」「呃…按照我们现在的营收状况，也就10000年左右吧！」"],["LEVEL5业界红人","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2虽然在业界仇人众多，但妮可还是屡次率领部下们从九死一生的险境里生还，狡兔屋的名气和经验也因此稳步提升。"],["LEVEL6侵蚀能量场","能量场对敌人造成伤害时，全队对该目标的暴击率提升1.5%，最多叠加10层，持续12秒，每层效果单独结算持续时间。选用更高级的机关弹药，装药量和浓缩以太物质含量均有所提高，更强的伤害、更长的持续时间…更贵的价格。"]],"skill":[{"title":"普通攻击：狡兔连打","desc":"点按发动：向前方进行至多三段的打击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/04/82232455/f5c64ccc1f41abd64199a2b42c93ba62_6503862040306265701.gif"},{"title":"普通攻击：为所欲为","desc":"发动[特殊技]、[强化特殊技]、[连携技]、[终结技]等招式后，能够上弹并强化[普通攻击]与[冲刺攻击]，提升子弹的威力。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/76099754/f14d604de4ef641603804fd16f79b39a_1164825057541222923.gif"},{"title":"闪避：脱兔","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果；拖曳摇杆发动闪避时，长按，可以在闪避中途上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/76099754/9b354f52945bde4557cacafdc846df98_7787188194292526242.gif"},{"title":"冲刺攻击：惊喜开箱","desc":"拖曳摇杆发动闪避后，点按发动：向对应方向冲刺，并对身周敌人进行打击，造成物理伤害；未拖曳摇杆发动闪避后，点按发动：向后躲避，并对前方敌人发动远程打击，造成物理伤害；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/76099754/adcb2e64f82049f13b4ccee40677b646_8593364043048039567.gif"},{"title":"闪避反击：牵制炮击","desc":"触发[极限闪避]后，点按发动：向后躲避，并对前方敌人发动远程打击，造成以太伤害；招式发动期间拥有无敌效果；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/76099754/0ddaa0294fb7253ab9cacba16d9cf014_3338274761591715863.gif"},{"title":"快速支援：救急炮击","desc":"当前操作中的角色被击飞时，点按发动：向后闪避，并对前方敌人发动远程打击，造成以太伤害；招式发动期间拥有无敌效果；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/ccace6b297526d413ea5df0c1a824aad_4176978141520535067.gif"},{"title":"招架支援：狡兔出手！","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/3d0eced10c4d6bc12497d725c8a6e58f_6057993770230285558.gif"},{"title":"支援突击：趁虚而入","desc":"发动[招架支援]后，点按发动：向前方突进后对敌人发动炮击，造成以太伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/40930b1ee72c4c81512e09c66b7a08af_5647535249702497914.gif"},{"title":"特殊技：糖衣炮弹","desc":"点按发动：对前方敌人发动远程打击，造成以太伤害；招式发动期间抗打断等级提升；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/3b192da37e3a03a2ddf4d53f06e46e1f_5626396734399534681.gif"},{"title":"强化特殊技：夹心糖衣炮弹","desc":"能量足够时，点按发动：对前方敌人发动强力远程打击，并在目标处生成能量场，持续牵引敌人，造成以太伤害；长按可以进行蓄力，在炮口生成小型能量场，持续消耗能量并对近处的敌人造成额外伤害；招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援];招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/c17a4a4af8026b2bb1c3dfa42a9839d7_5836282059647062278.gif"},{"title":"连携技：高价以太爆弹","desc":"触发[连携技]时，选择对应角色发动：对前方小范围敌人发动强力远程打击，并在目标处生成能量场，持续牵引周围敌人，造成以太伤害。招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援]；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/eb14b2d859a74aabdb6dc0ed9fa43b97_4334070865836306539.gif"},{"title":"终结技：特制以太榴弹","desc":"喧响等级达到[极]时，点按发动：对前方小范围敌人发动强力远程打击，并在目标处生成能量场，持续牵引周围敌人，造成以太伤害。招式发动时，队伍中其他角色回复10点能量，下一名换入前场的角色额外回复20点能量；招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援]；招式发动后自动上弹并强化[普通攻击]与[冲刺攻击]，最多触发8次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/158441880/8b91e0b7e3899b142cf737fae40b7bf4_3087338868568759333.gif"},{"title":"核心技","desc":"核心被动：机关箱妮可在[特殊技]、[强化特殊技]、[连携技]、[终结技]等招式中，上弹并强化[普通攻击]与[冲刺攻击]；强化子弹或能量场命中敌人时，目标的防御力降低20%，持续3.5秒。（此处数据为初始数据）额外能力：狡兔三窟队伍中存在与自身属性或阵营相同的角色时触发：妮可通过[核心被动：机关箱]对敌人施加减益效果时，全队对目标造成的以太伤害额外提升25%，持续3.5秒。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/03/34600917/c60e36aa0f46c342f743fed95c2856c7_3813518640764452621.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/80.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/80.md"},_=Object.assign(d,{setup(i){return(p,n)=>(o(),a("div",null,[e(t(c))]))}});export{l as __pageData,_ as default};
